@app.route('/check_image',methods=['POST'])
def check_image():
    received_data = request.get_json()
    # message = ''
    # received_data={
    #   'data': 'img base64',
    #   'owner': '32 bit id',
    #   'price': 10.0,
    #   'description': 'image information',
    #   'tags': ["tag1", "tag2"],
    # }
    clean_base64_data = received_data['data'].split('base64,')[1]

    received_img_hash = getImageAllHash(clean_base64_data)
    all_data = mini_chain.get_all_blocks_data()
    suspects = []
    for i,data in enumerate(all_data):
        for item in data['fingerprints']:
            likely = hash_all_similarity(received_img_hash,item)
            print(likely)
            if likely>=0.5:
                suspects.append([i,likely])
    # if hash_similarity(a_hash,b_hash)>=0.9:
    suspect_data = None
    if len(suspects)>0:
        message = '发现疑似图片'
        top_suspect = suspects[0]
        for suspect in suspects:
            if suspect[1] > top_suspect[1]:
                top_suspect = suspect
        suspect_data = all_data[top_suspect[1]]
    else:
        message = '原创图片'


    print(message)
    print(suspects)
    return {
        'message':message,
        'top_suspect':suspect_data
    }

@app.route('/add_to_chain',methods=['POST'])
def add_to_chain():
    received_data = request.get_json()
    # message = ''
    # received_data={
    #   'data': 'img base64',
    #   'owner': '32 bit id',
    #   'price': 10.0,
    #   'description': 'image information',
    #   'tags': ["tag1", "tag2"],
    # }
    clean_base64_data = received_data['data'].split('base64,')[1]

    received_img_hash = getImageAllHash(clean_base64_data)
    all_data = mini_chain.get_all_blocks_data()
    suspects = []
    for i,data in enumerate(all_data):
        for item in data['fingerprints']:
            likely = hash_all_similarity(received_img_hash,item)
            print(likely)
            if likely>=0.5:
                suspects.append([i,likely])
    # if hash_similarity(a_hash,b_hash)>=0.9:
    if len(suspects)==0:
        block_data = {
            'base64':clean_base64_data,
            'fingerprints':[received_img_hash],
            'timestamp':int(time.time()),
            'owner':received_data['owner'],
            'price':received_data['price'],
            'tags':received_data['tags'],
        }
        one_new_block = Block(block_data,previous_block_hash=mini_chain.get_last_block_hash())
        one_new_block.mine()
        mini_chain.add_block(one_new_block)
        message = '区块添加成功：'+one_new_block.hash()
    else:
        message = '区块添加失败，图像已存在'
    print(message)
    print(suspects)
    return message

